import React from "react";
import "./App.css";
import { Menu } from "./Menu";

import { Main } from "./Main";
import { About } from "./About";
import { Press } from "./Press";
import { Invest } from "./Invest";
import { Contact } from "./Contact";
import Page from "./Page";

import { BrowserRouter as Router, Switch } from "react-router-dom";

function App() {
    return (
        <Router>
            <div className="App">
                <Menu />
                <Switch>
                    <Page exact path="/" component={Main} title="HOME" description="A" />
                    <Page exact path="/about" component={About} title="ABOUT" description="A"/>
                    <Page exact path="/press" component={Press} title="PRESS" description="A"/>
                    <Page
                        exact
                        path="/invest"
                        component={Invest}
                        title="INVEST" description="A"
                    />
                    <Page
                        exact
                        path="/contact"
                        component={Contact}
                        title="CONTACT" description="A"
                    />
                    <Page
                        exact
                        path="/hertz-lite"
                        component={Contact}
                        title="HERTZ LITE" description="H"
                    />
                    <Page
                        exact
                        path="/hertz-black"
                        component={HertzLite}
                        title="HERTZ BLACK" description="H"
                    />
                    <Page
                        exact
                        path="/hertz-black"
                        component={HertzBlack}
                        title="HERTZ BLACK" description="H"
                    />
                    <Page
                        exact
                        path="/hertz-black"
                        component={MotherCare}
                        title="HERTZ BLACK" description="H"
                    />
                </Switch>
            </div>
        </Router>
    );
}

export default App;
